CREATE PROCEDURE [dbo].[Usp_Editvehicletypehireterms]
@Termcode BIGINT,
@Mondayprice DECIMAL(10,2),
@Tuesdayprice DECIMAL(10,2),
@Wednesdayprice DECIMAL(10,2),
@Thursdayprice DECIMAL(10,2),
@Fridayprice DECIMAL(10,2),
@Saturdayprice DECIMAL(10,2),
@Sundayprice DECIMAL(10,2)
AS

BEGIN
SET NOCOUNT ON;
If(@Type = 0)
Select VT.Typename as Text, VT.Typecode as Value From Compvehicletypes VT;
If(@Type = 1)
Select r.Relname as Text, r.Relcode as Value From Relationships r;
If(@Type = 2)
Select CV.Regno as Text, Cv.Vehiclecode as Value From Companyvehicles CV WHERE CV.Carstatus=0;
If(@Type = 3)
Select C.Capname as Text, C.Capcode as Value From Capacity C;
END

CREATE PROCEDURE [dbo].[Usp_GetListModel]
@Type int
AS

BEGIN
   BEGIN
	DECLARE 
			@Paycode BIGINT=0,
			@RespStat int = 0,
			@RespMsg varchar(150) = ''
			BEGIN

		BEGIN TRY	
		--Validate

		Declare @RunNoTable TABLE (RunNo Varchar(20))
		INSERT INTO @RunNoTable Exec Usp_GenerateRunNo 'VPM'  
		Select @Paycode = RunNo From @RunNoTable
		BEGIN TRANSACTION;
		    INSERT INTO Vehiclepayments(Paycode,Assigncode,Tripbalance,Tripamount,Paymentmode,Paidamount,Paidby,Createdby)
			VALUES(@Paycode,@Assigncode,@Tripbalance,@Tripamount,@Paymentmode,@Paidamount,@Paidby,@Createdby)
			IF @Tripbalance=0
			BEGIN
			 Update Assigncustomercar Set Ispaid=1 WHERE Assigncode=@Assigncode
			END
		Set @RespMsg ='Saved Successfully.'
		Set @RespStat =0; 
		COMMIT TRANSACTION;
		Select @RespStat as RespStatus, @RespMsg as RespMessage;

		END TRY
		BEGIN CATCH
		ROLLBACK TRANSACTION
		PRINT ''
		PRINT 'Error ' + error_message();
		Select 2 as RespStatus, '0 - Error(s) Occurred' + error_message() as RespMessage
		END CATCH
		Select @RespStat as RespStatus, @RespMsg as RespMessage;
		RETURN; 
		END;
	END
END

